import React from "react";
import { Table } from "antd";

const columns = [
  {
    title: "ID",
    dataIndex: "id",
    key: "id",
  },
  {
    title: "Name",
    dataIndex: "name",
    key: "name",
    render: (name) => <a>{name}</a>,
  },
  {
    title: "Status",
    dataIndex: "status",
    key: "status",
  },
  {
    title: "Address",
    dataIndex: "address_link",
    key: "address",
  },
  {
    title: "Country Code",
    dataIndex: "countryIsoCode",
    key: "countryCode",
  },
];

const HcpTable = ({ data }) => (
  <Table columns={columns} dataSource={data} rowKey="id" />
);

export default HcpTable;
